import React, { Component } from "react";

export default class TeacherRequestProfile extends Component {
  makeDeactive = (btn, ac) => {
    btn.classList.remove("btn-success");
    btn.classList.add("btn-danger");
    btn.innerHTML = "Deactive";

    ac.classList.remove("text-danger");
    ac.classList.add("text-success");
    ac.innerHTML = "True";
  };

  makeActive = (btn, ac) => {
    btn.classList.remove("btn-danger");
    btn.classList.add("btn-success");
    btn.innerHTML = "Active";

    ac.classList.remove("text-success");
    ac.classList.add("text-danger");
    ac.innerHTML = "False";
  };

  activeUser = () => {
    let ac = document.querySelector(".ac");
    let btn = document.querySelector(".ac-dc-btn");
    if (btn.classList.value.includes("btn-danger")) this.makeActive(btn, ac);
    else this.makeDeactive(btn, ac);
  };

  deleteWarning = () => {
    document.querySelector(".delete").classList.remove("d-none");
  };

  close(xe) {
    xe.preventDefault();
    document.querySelector(".join").classList.toggle("d-none");
    document.body.style.overflowY = "scroll";
  }
  render() {
    return (
      <div>
        <div className="main-body">
          <h1 className="text-center mb-5">Personal Info</h1>
          <div className="row gutters-sm">
            <div className="col-md-4 mb-3">
              <div className="card">
                <div className="card-body">
                  <div className="d-flex flex-column align-items-center text-center">
                    <img
                      src={"https://bootdey.com/img/Content/avatar/avatar7.png"}
                      alt="Admin"
                      className="rounded-circle"
                      width="150"
                    />

                    <div className="mt-3">
                      <h4>Mr Mohamed</h4>
                      <p className="text-secondary mb-1">
                        math physics algebra
                      </p>
                      <p className="text-muted font-size-sm">
                        El khalige, aman, elbehera
                      </p>
                    </div>
                  </div>

                  <p className="fw-bold text-center">
                    Active:<span className="ac text-danger">False</span>
                  </p>
                </div>
              </div>
            </div>
            <div className="col-md-8">
              <div className="border">
                <div className="card-body">
                  <div className="row">
                    <div className="col-sm-3">
                      <h6 className="mb-0 fw-bold text-dark">Full Name</h6>
                    </div>
                    <div className="col-sm-9 text-secondary">
                      Kenneth Valdez
                    </div>
                  </div>
                  <hr />
                  <div className="row">
                    <div className="col-sm-3">
                      <h6 className="mb-0 fw-bold text-dark">Email</h6>
                    </div>
                    <div className="col-sm-9 text-secondary">fip@jukmuh.al</div>
                  </div>
                  <hr />
                  <div className="row">
                    <div className="col-sm-3">
                      <h6 className="mb-0 fw-bold text-dark">Phone</h6>
                    </div>
                    <div className="col-sm-9 text-secondary">
                      (239) 816-9029
                    </div>
                  </div>
                  <hr />
                  <div className="row">
                    <div className="col-sm-3">
                      <h6 className="mb-0 fw-bold text-dark">Country</h6>
                    </div>
                    <div className="col-sm-9 text-secondary">Cairo</div>
                  </div>
                  <hr />
                  <div className="row">
                    <div className="col-sm-3">
                      <h6 className="mb-0 fw-bold text-dark">Gender</h6>
                    </div>
                    <div className="col-sm-9 text-secondary">Maile</div>
                  </div>
                  <hr />
                  <div className="row">
                    <div className="col-sm-3">
                      <h6 className="mb-0 fw-bold text-dark">Type</h6>
                    </div>
                    <div className="col-sm-9 text-secondary">Teacher</div>
                  </div>
                  <hr />
                  <div>
                    <div className="d-flex  justify-content-between w-50 mx-auto">
                      <button
                        className="btn btn-success ac-dc-btn"
                        onClick={this.activeUser}
                      >
                        Accept
                      </button>
                      <button className="btn btn-outline-danger">Refuse</button>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>

          <div className="skills ">
            <div className="gap"></div>
            <h3>Subjects</h3>
            <ul className="p-3 w-50">
              <hr />
              <li className="pt-3">Mathematics</li>
              <li className="pt-3">Physics</li>
              <li className="pt-3">Algepra</li>
              <li className="pt-3">euclidean geometry</li>
              <li className="pt-3">Calculus</li>
            </ul>
          </div>

          <div className="gap"></div>

          <div className="qualifications">
            <h3>qualifications</h3>

            <ul className="p-3 w-50">
              <hr />
              <img
                src={
                  "data:image/jpeg;base64,"
                }
                style={{ width: "230px", height: "230px" }}
                className="rounded mr-3 mb-3"
              />
              <img
                style={{ width: "230px", height: "230px" }}
                className="rounded mr-3 mb-3"
                src={
                  "data:image/jpeg;base64,"
                }
              />
              <img
                style={{ width: "230px", height: "230px" }}
                className="rounded mr-3 mb-3"
                src={
                  "data:image/jpeg;base64,"
                }
              />
            </ul>
          </div>

          <div className="gap"></div>

          <div className="Video">
            <div className="w-50">
              <h3>Video</h3>

              <hr className="mt-5" />
            </div>

            <p className="w-50 mt-5">
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Excepturi
              aspernatur vero, consectetur nobis dolores rem?
            </p>
            <video width="550" height="340" className="mt-5 " controls>
              <source src="movie.mp4" type="video/mp4" />
            </video>
            <div className="gap"></div>
          </div>
        </div>
      </div>
    );
  }
}
